import React from 'react'

class Plus extends React.Component {
    onClickButton = () => {
        this.props.sumNumber();
    };

    render() {
        return (
            <div>
                <button onClick={this.onClickButton} >Plus</button>
            </div>
        )
    }
}

export default Plus;
